import './App.css';
import React, { useState } from 'react';


function App() {

    const initObj = {
        prop1: 'value1',
        prop2: 'value2',
        prop3: 'value3',
    }

    function App() {
        const [obj, setObj] = useState(initObj);

        return <div>
            {obj.prop1}-{obj.prop2}-{obj.prop3}
        </div>;
    }

}
export default App;
